import React, {useState} from "react";
import axios from "axios";

export function Delivery(){
    const [credentials, setCredentials] = useState()

    const submitresponse= (event) => {
        console.log(event.target.username)
        axios.post("http://localhost:9087/customer",credentials)
            .then(response => {console.log(response)})
            .catch(error => {console.log(error)})
        event.preventDefault()
    }
    return (
        <form onSubmit={submitresponse}>
            Name: <input type="text"  onChange={(e)=>{setCredentials({...credentials,name:e.target.value})}}/>
            Phone: <input type="text"  onChange={(e)=>{setCredentials({...credentials,phone:e.target.value})}}/>
            Email: <input type="text"  onChange={(e)=>{setCredentials({...credentials,email:e.target.value})}}/>
            Username: <input type="text"  onChange={(e)=>{setCredentials({...credentials,username:e.target.value})}}/>
            Password: <input type="password" onChange={(e)=>{setCredentials({...credentials,password:e.target.value})}}/>
            <input type="submit" onChange={submitresponse}/>
        </form>
    )
}
